import React from "react";
import PropTypes from "prop-types";
import PrimeraApp from "./AaaComponentes";

const CounterApp = (value=123) => {

    return (
        <>
            <p> CounterApp </p>
            <p> {value} </p>
        </>
    )
}

PrimeraApp.propTypes = {
    value: PropTypes.string.isRequired
}

export default CounterApp;
